import React from "react";
import StripeCheckout from "react-stripe-checkout";
// import { ReactComponent as Logo } from '../../assets/wizy_logo.svg';

const StripeCheckoutButton = ({ price }, cartItems) => {
  const priceForStripe = price * 100;
  const publishableKey =
    "pk_test_51HKFQaCHuUVJ8ShaaUSrsvQK4P9wyNwliSnSqZIq8R00fdlAA08MX1vg5t9EiResWfkWxT0rGrSDnDJK4JSHHyQ200bkN4nQvg";

  const onToken = (token) => {
    console.log(token);
    alert('Payment Successful!')
    //
  };
  console.log(cartItems, price)
  return (
    <StripeCheckout
      label="Pay Now"
      name="Wizy Clothing"
      billingAddress
      shippingAddress
      image='data:image/svg+xml;base64,'
      description={`Your total is $${price}`}
      amount={priceForStripe}
      panelLabel="Pay Now"
      token={onToken}
      stripeKey={publishableKey}
    />
  );
};

export default StripeCheckoutButton;
